import React from 'react';
import { Link } from 'react-router-dom';

function EventList({ events }) {
  return (
    <div>
      <h1>Event List</h1>
      {events.map(event => (
        <div key={event.id}>
          <h2>{event.name}</h2>
          <p>{event.description}</p>
          <Link to={`/events/${event.id}`}>View Details</Link> {/* Passing event.id */}
        </div>
      ))}
    </div>
  );
}

export default EventList;
